// Helper function to check if an icon name is valid
export function isValidIconName(name) {
  return VALID_ICON_NAMES.includes(name)
}

// Common icon aliases to help prevent mistakes
export const ICON_ALIASES = {
  'ui-search': 'ui-magnifyingglass', // Use magnifyingglass, not search
  'ui-email': 'ui-mail', // Use mail or envelope
  'ui-close': 'ui-x', // Use ui-x, not cross (cross is religious symbol)
  'ui-cancel': 'ui-x',
  'ui-remove': 'ui-x',
}

// Get the correct icon name, resolving aliases
export function getIconName(name) {
  if (!name) return null

  // Check if it's an alias
  if (ICON_ALIASES[name]) {
    console.warn(`Icon "${name}" is an alias. Use "${ICON_ALIASES[name]}" instead.`)
    return ICON_ALIASES[name]
  }

  // Check if it's valid
  if (!isValidIconName(name)) {
    console.error(`Icon "${name}" does not exist. Check iconNames.js for valid names.`)
    return null
  }

  return name
}
